import { jsPDF } from "jspdf";
import { fileURLToPath } from "url";
import path from "path";

const __filename = fileURLToPath(import.meta.url);
const __dirname = path.dirname(__filename);

/**
 * Genera pdf del contrato
 * @param {Object} param0 objeto de empresa
 */
const generatePDF = ({
  id,
  date,
  datos_tafico: { origen, destino, mercaderia, crt },
  emp_contratada: { empresa, id_tributaria },
  datos_unidad: { placa_tractor, placa_semi, chofer, dni },
  datos_facturacion: { razon_facturacion, cuit_rut_facturacion },
  contratacion: { valor, moneda, condicion_pago },
  recordatorios,
}) => {
  let fecha = new Date();
  let meses = [
    "Enero",
    "Febrero",
    "Marzo",
    "Abril",
    "Mayo",
    "Junio",
    "Julio",
    "Agosto",
    "Septiembre",
    "Octubre",
    "Noviembre",
    "Diciembre",
  ];
  let fechaFormateada =
    fecha.getDate() +
    " de " +
    meses[fecha.getMonth()] +
    " de " +
    fecha.getFullYear();

  const pdf = new jsPDF({
    format: "a4",
  });

  pdf.addImage(
    `data:image/png;base64,`,
    "JPEG",
    20,
    12,
    80,
    30
  );

  pdf.setLineWidth(0.4);
  pdf.setDrawColor(0, 0, 0);
  pdf.line(20, 250, 70, 250);
  pdf.line(140, 250, 190, 250);
  pdf.setFontSize(8);
  pdf.setFont("Helvetica", "bold");
  pdf.text("Firma Contratente", 45, 253, null, null, "center");
  pdf.text("Firma Contratado", 165, 253, null, null, "center");

  pdf.setDrawColor(107, 107, 107);
  pdf.setLineWidth(0.7);
  pdf.line(123, 10, 123, 30);
  pdf.line(192, 10, 192, 30);

  pdf.setDrawColor(135, 135, 135);
  pdf.line(127, 15, 188, 15);
  pdf.line(127, 25, 188, 25);
  pdf.setFontSize(12);
  pdf.setFont("Helvetica", "bold");
  pdf.text("CONTRATO DE FLETE", 157.5, 21.5, null, null, "center");

  pdf.setFontSize(9);
  pdf.text("TRANSPORTE AMG", 157.5, 35, null, null, "center");

  pdf.setFont("Helvetica", "normal");
  pdf.setFontSize(8);
  pdf.text("Nueva y Santa Cruz S/N,", 157.5, 40, null, null, "center");
  pdf.text("Ingeniero Giagnoni, Mendoza", 157.5, 43, null, null, "center");
  pdf.text("Tel: +5492634715632", 157.5, 46, null, null, "center");
  pdf.text(
    "Mail: diegogonzalez@transporteamg.com.ar",
    157.5,
    49,
    null,
    null,
    "center"
  );

  pdf.line(10, 60, 200, 60);
  pdf.line(10, 70, 200, 70);

  pdf.setFontSize(10);
  pdf.text(date || fechaFormateada, 15, 66);
  pdf.text(`Número de contrato: ${id}`, 195, 66, null, null, "right");

  //////////////////////////////////////////////////

  pdf.setDrawColor(156, 156, 156);
  pdf.line(15, 85, 195, 85);
  pdf.setFont("Helvetica", "bold");
  pdf.setFontSize(10);
  pdf.text("DATOS DEL TRAFICO", 17, 83);

  //////////////////////////////////////////////////

  pdf.text("Origen:", 17, 90);
  pdf.text("Destino:", 110, 90);
  pdf.text("Mercadería:", 17, 95);
  if (crt) {
    pdf.text("CRT:", 110, 95);
  }

  //////////////////////////////////////////////////

  pdf.setFontSize(9);
  pdf.setFont("Helvetica", "normal");
  // ORIGEN
  pdf.text(origen, 42, 90);
  // DESTINO
  pdf.text(destino, 130, 90);
  // MERCADERIA
  pdf.text(mercaderia, 42, 95);
  if (crt) {
    // CRT
    pdf.text(crt, 130, 95);
  }

  pdf.line(15, 98, 195, 98);

  //////////////////////////////////////////////////

  pdf.setFont("Helvetica", "bold");
  pdf.setFontSize(10);
  pdf.text("DATOS DEL CAMION CONTRATADO", 17, 110);
  pdf.line(15, 113, 195, 113);

  //////////////////////////////////////////////////

  pdf.text("EMP. CONTRATADA:", 17, 118);
  pdf.text("ID TRIBUTARIA:", 110, 118);
  pdf.text("PLACA TRACTOR:", 17, 123);
  pdf.text("PLACA SEMI:", 110, 123);
  pdf.text("CHOFER:", 17, 128);
  pdf.text("DNI:", 110, 128);

  //////////////////////////////////////////////////

  pdf.setFontSize(9);
  pdf.setFont("Helvetica", "normal");
  // EMPRESA
  pdf.text(empresa, 55, 118);
  // ID TRIBUTARIA
  pdf.text(id_tributaria, 145, 118);

  // PATENTE TRACTOR
  pdf.text(placa_tractor, 55, 123);
  // PATENTE SEMI
  pdf.text(placa_semi, 145, 123);

  // NOMBRE CHOFER
  pdf.text(chofer, 55, 128);
  // PATENTE SEMI
  pdf.text(dni, 145, 128);

  pdf.line(15, 130, 195, 130);

  //////////////////////////////////////////////////

  pdf.setFont("Helvetica", "bold");
  pdf.setFontSize(10);
  pdf.text("DATOS DE CONTRATACION", 17, 145);
  pdf.line(15, 148, 195, 148);

  //////////////////////////////////////////////////

  pdf.text("VALOR DE FLETE:", 17, 153);
  pdf.text("MONEDA:", 110, 153);
  pdf.text("RAZON SOCIAL:", 17, 158);
  pdf.text("CUIT/RUT:", 110, 158);
  pdf.text("COND. PAGO:", 17, 163);

  //////////////////////////////////////////////////

  pdf.setFontSize(9);
  pdf.setFont("Helvetica", "normal");
  // MONTO DE PAGO
  pdf.text(valor, 55, 153);
  // MONEDA DE PAGO
  pdf.text(moneda, 135, 153);
  pdf.text(razon_facturacion, 55, 158);
  pdf.text(cuit_rut_facturacion, 135, 158);
  // CONDICION DE PAGO
  pdf.text(condicion_pago, 55, 163);

  pdf.line(15, 165, 195, 165);

  //////////////////////////////////////////////////

  pdf.setFont("Helvetica", "bold");
  pdf.setFontSize(10);
  pdf.text("RECORDATORIOS", 17, 175);
  pdf.line(15, 178, 195, 178);

  /////////////////////////////////////////////////

  pdf.setFontSize(9);
  pdf.setFont("Helvetica", "normal");
  // DESCRIPCION RECORDATORIOS MAX 250 CARACTERES
  pdf.text(
    recordatorios,
    105,
    183,
    {
      maxWidth: 176,
      align: "center",
    },
    null
  );

  pdf.line(15, 193, 195, 193);

  pdf.save(path.join(__dirname, "../public/contrato.pdf"));
};

export default generatePDF;
